import React from "react";
import { Card,Image } from "react-bootstrap";
import default_awatar from "../img/defaut_awatar.jpg"

const UserPage = () => {

    return (
        <Card
            style={{borderRadius: 20, margin: '0px 10px 0px 10px'}}
        >
            <div className="flex">
                <Image
                    style={{margin: 20}}
                    src = {default_awatar}
                    width={400}
                    height={400}
                    rounded
                ></Image>
                Филатьев Владислав Евгеньевич
            </div>


        </Card>
    );
};

export default UserPage;
